// Navbar.jsx
import React from 'react';
import './Navbar.css';
import mentorImg from './mentor.png';

function Navbar() {
  const projects = [
    { name: 'Placement Predictor', href: '/placement' },
    { name: 'Human Detection', href: '/human-detection' },

  ];

  return (
    <div className="navbar-container">
      <div className="header">
        <img src={mentorImg} alt="Hanumat Lal Vishwakarma" className="mentor-img" />
        <div className="text-info">
          <h1 className="name">Hanumat Lal Vishwakarma</h1>
          <p className="tagline">Welcome to my Project Page!</p>
          <p className="about">
            I'm currently working as a DevOps Engineer at Rakuten Group Inc., Tokyo, Japan. With a strong academic foundation — M.Tech in CSE from IIT Ropar and B.Tech in CSE from NIT Manipur — I’m passionate about building intelligent systems that make an impact. My core skills span across Python, C/C++, SQL, Data Science, ML/DL, Docker, Kubernetes, Jenkins, and more. I’m dedicated to sharing knowledge through professional, free, and hands-on projects in AI and Machine Learning.
          </p>
        </div>
      </div>

      <div className="project-links">
        {projects.map((project) => (
          <a key={project.name} href={project.href} className="project-link">
            {project.name}
          </a>
        ))}
      </div>
    </div>
  );
}

export default Navbar;
